import { FETCH_USER_SUCCESS } from "../types"

const initailState = {
    user: []
}

const getEmail = (state = initailState,action)=>{

    switch (action.type) {
        case FETCH_USER_SUCCESS:
            return{
                user: action.payload
            }
        default:
            break;
    }
}

export default getEmail
